import React, { Component } from 'react'
import { CollectionItem, Row, Col } from 'react-materialize'

class Book extends Component {
  render() {
    const { book } = this.props
    return (
      <CollectionItem>
        <Row>
          <Col>{book.title}</Col>
          <Col>{book.subtitle}</Col>
          <Col>{book.author}</Col>
          <Col>{book.description}</Col>
          <Col>${book.price}</Col>
          <Col><button>Add to Cart</button></Col>
        </Row>
      </CollectionItem>
    )
  }
}

export default Book
